import React, { Component } from "react";
// import What from './components/What/What';
import classes from "./ArticlesPanel.module.css";

class ArticlesPanel extends Component {
  newArticlePrw = {
    title: "title",
    content: "Content",
    preview: "url",
    id: 0
  };

  newArticle = {
    title: "title",
    content: "Content",
    preview: "url"
  };

  // let createFunc = (com) => {
  //   let newCom = event.target.value;

  //   newArticlePrw.{com} = newCom;

  // }

  render() {
    let setTitle = event => {
      let newCom = event.target.value;
      this.newArticlePrw.title = newCom;
      this.newArticle.title = newCom;
    };
    let setContentPrw = event => {
      let newCom = event.target.value;
      this.newArticlePrw.content = newCom;
    };
    let setContent = event => {
      let newCom = event.target.value;
      this.newArticle.content = newCom;
    };
    let setUrl = event => {
      let newCom = event.target.value;
      this.newArticlePrw.url = newCom;
      this.newArticle.url = newCom;
    };
    return (
      <div className={classes.ArticlesPanel}>
        <h1>Add article</h1>
        <input
          onChange={setTitle}
          className={classes.Inputs}
          type="text"
          placeholder="Article`s title"
        />
        <input
          onChange={setUrl}
          className={classes.Inputs}
          type="text"
          placeholder="Picture`s url"
        />
        <input
          onChange={setContentPrw}
          className={classes.Inputs}
          type="text"
          placeholder="Preview content"
        />
        <input
          onChange={setContent}
          className={classes.Inputs}
          type="text"
          placeholder="Full content"
        />
        <button>Add</button>
      </div>
    );
  }
}

export default ArticlesPanel;
